const createPushNotificationsJobs = (jobs, queue) => {
  jobs.forEach((data) => {
    const job = queue.create("push_notification_code_3", data)
  	        .save((err) => {
                  if(!err) console.log(`Notification job created: ${job.id}`);
  		});
